import React from "react";
import "../App.css";

const Sidebar = () => {
  return (
    <div className="w-24 h-screen absolute grid items-center inset-0 bg-slate-500">
      <div className="container">
        <img src="" alt="Gambars" />
        <h2>Task App</h2>
      </div>

      <div className="container">
        <h3>QUICK MENU</h3>
        <ul className="list-none grid">
          <li></li>
        </ul>
      </div>
    </div>
  );
};

export default Sidebar;
